def find_nth_fibonacci_number_in_range(start: int, end: int, n: int) -> int:
    """"""
    fibonacci_sequence = []
    (num1, num2) = (0, 1)
    while num2 <= end:
        if num2 >= start:
            fibonacci_sequence.append(num2)
        (num1, num2) = (num2, num1 + num2)
    return fibonacci_sequence[n - 1] if n <= len(fibonacci_sequence) else -1
